import React, { useState } from 'react';
import './../css/ComprarPlantas.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from './NavBar';
import Fotter from './Fotter';

function PreguntasFrecuentes() {

    const [priceGap] = useState(1000);

    useEffect(() => {
        const rangeInput = document.querySelectorAll(".range-input input");
        const priceInput = document.querySelectorAll(".price-input input");
        const range = document.querySelector(".slider .progress");

        const handlePriceInput = (e) => {
            let minPrice = parseInt(priceInput[0].value);
            let maxPrice = parseInt(priceInput[1].value);

            if ((maxPrice - minPrice >= priceGap) && maxPrice <= rangeInput[1].max) {
                if (e.target.className === "input-min") {
                    rangeInput[0].value = minPrice;
                    range.style.left = ((minPrice / rangeInput[0].max) * 100) + "%";
                } else {
                    rangeInput[1].value = maxPrice;
                    range.style.right = 100 - (maxPrice / rangeInput[1].max) * 100 + "%";
                }
            }
        };

        const handleRangeInput = (e) => {
            let minVal = parseInt(rangeInput[0].value);
            let maxVal = parseInt(rangeInput[1].value);

            if ((maxVal - minVal) < priceGap) {
                if (e.target.className === "range-min") {
                    rangeInput[0].value = maxVal - priceGap;
                } else {
                    rangeInput[1].value = minVal + priceGap;
                }
            } else {
                priceInput[0].value = minVal;
                priceInput[1].value = maxVal;
                range.style.left = ((minVal / rangeInput[0].max) * 100) + "%";
                range.style.right = 100 - (maxVal / rangeInput[1].max) * 100 + "%";
            }
        };

        priceInput.forEach(input => {
            input.addEventListener("input", handlePriceInput);
        });

        rangeInput.forEach(input => {
            input.addEventListener("input", handleRangeInput);
        });

        return () => {
            // Limpiar event listeners al desmontar el componente
            priceInput.forEach(input => {
                input.removeEventListener("input", handlePriceInput);
            });

            rangeInput.forEach(input => {
                input.removeEventListener("input", handleRangeInput);
            });
        };
    }, [priceGap]);


    return (
        <div className="contenedor_compra_plantas">
            <Navbar />
            <div className="contenedor_filtros_secciones">
                <div className="contenedor_titulo_filtros">
                    <div className="contenedor_titulo_filtros_content">
                        <div className="titulo_filtros">Filtrar</div>
                        <div className="contenedor_filtros">
                            <div className="contenedor_filtros_precio">
                                <div className="contenedor_filtros_precio_titulo">Precio</div>

                                <header>
                                    <h2>Price Range</h2>
                                    <p>Use slider or enter min and max price</p>
                                </header>
                                <div class="price-input">
                                    <div class="field">
                                    <span>Min</span>
                                    <input type="number" class="input-min" value="2500"/>
                                    </div>
                                    <div class="separator">-</div>
                                    <div class="field">
                                    <span>Max</span>
                                    <input type="number" class="input-max" value="7500"/>
                                    </div>
                                </div>
                                <div class="slider">
                                    <div class="progress"></div>
                                </div>
                                <div class="range-input">
                                    <input type="range" class="range-min" min="0" max="10000" value="2500" step="100"/>
                                    <input type="range" class="range-max" min="0" max="10000" value="7500" step="100"/>
                                </div>


                            </div>
                        </div>
                    </div>
                </div>
                <div className="contenedor_secciones">
                    {/* Aquí va el contenido de las secciones */}
                </div>
            </div>
            <Fotter />
        </div>
    );
}

export default PreguntasFrecuentes;
